import "./table.css"
import { useSelector } from 'react-redux';
import React from 'react';

import {deleteWorker, updateWorker} from "../../actions/auth";

const TableWorker = ({post}) => {
    

    return(
        <>
            <div className="App">
            <table>
                <tr>
                <th>First Name</th>
                <th>Last Name</th>
                <th>CNIC</th>
                <th>Work</th>
                <th>Contact</th>
                <th>Salary</th>
                <th>Description</th>
                <th>Update</th>
                <th>Delete</th>
                </tr>
                
        
                return (
                    <tr >
                    <td>{post.firstName}</td>
                    <td> {val.lastName}</td>
                    <td> {val.cnic}</td>
                    <td> {val.work}</td>
                    <td> {val.contact}</td>
                    <td> {val.salary}</td>
                    <td> {val.description}</td>
                    <td><button onClick={() => dispatch(updateWorker(val._id))}>U</button></td>
                    <td><button onClick={() => dispatch(deleteWorker(val._id))}>D</button></td>
                    </tr>
                )
                })}
            </table>
            </div>

        </>
    );
}

export default TableWorker;
